import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../CSS Sheets/ResultsPage.css';

interface ResultData {
    card: string;
    id: string;
    Ungraded: string;
    'Grade 1': string;
    'Grade 2': string;
    'Grade 3': string;
    'Grade 4': string;
    'Grade 5': string;
    'Grade 6': string;
    'Grade 7': string;
    'Grade 8': string;
    'Grade 9': string;
    'Grade 9.5': string;
    'SGC 10': string;
    'CGC 10': string;
    'PSA 10': string;
    'BGS 10': string;
    'BGS 10 Black': string;
    'CGC 10 Pristine': string;
    final_link: string;
}

interface CardTotals {
    Ungraded: string;
    'Grade 1': string;
    'Grade 2': string;
    'Grade 3': string;
    'Grade 4': string;
    'Grade 5': string;
    'Grade 6': string;
    'Grade 7': string;
    'Grade 8': string;
    'Grade 9': string;
    'Grade 9.5': string;
    'SGC 10': string;
    'CGC 10': string;
    'PSA 10': string;
    'BGS 10': string;
    'BGS 10 Black': string;
    'CGC 10 Pristine': string;
    card_count: string;
}

const ResultsPage: React.FC = () => {
    const [results, setResults] = useState<ResultData[]>([]);
    const [totals, setTotals] = useState<CardTotals | null>(null);
    const [error, setError] = useState<string | null>(null);
    const navigate = useNavigate();

    useEffect(() => {
        const fetchResults = async () => {
            try {
                const response = await fetch('http://localhost:8000/results');
                if (!response.ok) {
                    const errorText = await response.text();
                    throw new Error(`Failed to fetch results: ${response.status} - ${errorText}`);
                }
                const data = await response.json();
                // Extract and convert the results from the response to lowercase for card and id
                const formattedResults = data.results.map((item: ResultData) => ({
                    ...item,
                    card: item.card.toLowerCase(),
                    id: item.id.toLowerCase(),
                }));
                setResults(formattedResults);
    
                // Set totals directly
                setTotals(data.totals);
            } catch (err) {
                setError((err as Error)?.message || 'An unknown error occurred');
                console.error('Error fetching results:', err);
            }
        };
    
        fetchResults();
    }, []);
    
    const convertToCSV = (data: ResultData[]) => {
        const header = [
            'Card',
            'ID',
            'Ungraded',
            'Grade 1',
            'Grade 2',
            'Grade 3',
            'Grade 4',
            'Grade 5',
            'Grade 6',
            'Grade 7',
            'Grade 8',
            'Grade 9',
            'Grade 9.5',
            'SGC 10',
            'CGC 10',
            'PSA 10',
            'BGS 10',
            'BGS 10 Black',
            'CGC 10 Pristine',
            'Final Link',
        ].join(',');

        const rows = data.map(item => [
            item.card,
            item.id,
            item.Ungraded,
            item['Grade 1'],
            item['Grade 2'],
            item['Grade 3'],
            item['Grade 4'],
            item['Grade 5'],
            item['Grade 6'],
            item['Grade 7'],
            item['Grade 8'],
            item['Grade 9'],
            item['Grade 9.5'],
            item['SGC 10'],
            item['CGC 10'],
            item['PSA 10'],
            item['BGS 10'],
            item['BGS 10 Black'],
            item['CGC 10 Pristine'],
            item.final_link,
        ].join(',')).join('\n');

        return `${header}\n${rows}`;
    };

    const downloadCSV = () => {
        const csvData = convertToCSV(results);
        const blob = new Blob([csvData], { type: 'text/csv;charset=utf-8;' });
        const link = document.createElement('a');
        link.href = URL.createObjectURL(blob);
        link.setAttribute('download', 'results.csv');
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    };

    const goHome = () => {
        navigate('/'); // Navigate to the root path
    };

    // Function to calculate totals for each grade category
    const calculateTotals = (results: ResultData[]) => {
        const initialTotals = {
            Ungraded: 0,
            'Grade 1': 0,
            'Grade 2': 0,
            'Grade 3': 0,
            'Grade 4': 0,
            'Grade 5': 0,
            'Grade 6': 0,
            'Grade 7': 0,
            'Grade 8': 0,
            'Grade 9': 0,
            'Grade 9.5': 0,
            'SGC 10': 0,
            'CGC 10': 0,
            'PSA 10': 0,
            'BGS 10': 0,
            'BGS 10 Black': 0,
            'CGC 10 Pristine': 0,
        };

        return results.reduce((totals, item) => {
            totals.Ungraded += parseInt(item.Ungraded) || 0;
            totals['Grade 1'] += parseInt(item['Grade 1']) || 0;
            totals['Grade 2'] += parseInt(item['Grade 2']) || 0;
            totals['Grade 3'] += parseInt(item['Grade 3']) || 0;
            totals['Grade 4'] += parseInt(item['Grade 4']) || 0;
            totals['Grade 5'] += parseInt(item['Grade 5']) || 0;
            totals['Grade 6'] += parseInt(item['Grade 6']) || 0;
            totals['Grade 7'] += parseInt(item['Grade 7']) || 0;
            totals['Grade 8'] += parseInt(item['Grade 8']) || 0;
            totals['Grade 9'] += parseInt(item['Grade 9']) || 0;
            totals['Grade 9.5'] += parseInt(item['Grade 9.5']) || 0;
            totals['SGC 10'] += parseInt(item['SGC 10']) || 0;
            totals['CGC 10'] += parseInt(item['CGC 10']) || 0;
            totals['PSA 10'] += parseInt(item['PSA 10']) || 0;
            totals['BGS 10'] += parseInt(item['BGS 10']) || 0;
            totals['BGS 10 Black'] += parseInt(item['BGS 10 Black']) || 0;
            totals['CGC 10 Pristine'] += parseInt(item['CGC 10 Pristine']) || 0;
            return totals;
        }, initialTotals);
    };

    const totalsRow = calculateTotals(results);

    return (
        <div>
            <h1>Results</h1>
            {error && <p>Error: {error}</p>}
            <button onClick={downloadCSV} style={{ marginBottom: '20px' }} className="download-button">
                Download CSV
            </button>
            <button onClick={goHome} style={{ marginBottom: '20px', marginLeft: '10px' }}>
                Return to Input Page
            </button>
            <table className="results-table">
                <thead>
                    <tr>
                        <th>Card</th>
                        <th>ID</th>
                        <th>Ungraded</th>
                        <th>Grade 1</th>
                        <th>Grade 2</th>
                        <th>Grade 3</th>
                        <th>Grade 4</th>
                        <th>Grade 5</th>
                        <th>Grade 6</th>
                        <th>Grade 7</th>
                        <th>Grade 8</th>
                        <th>Grade 9</th>
                        <th>Grade 9.5</th>
                        <th>SGC 10</th>
                        <th>CGC 10</th>
                        <th>PSA 10</th>
                        <th>BGS 10</th>
                        <th>BGS 10 Black</th>
                        <th>CGC 10 Pristine</th>
                        <th>Final Link</th>
                    </tr>
                </thead>
                <tbody>
                    {results.length > 0 ? (
                        results.map((result, index) => (
                            <tr key={index}>
                                <td>{result.card}</td>
                                <td>{result.id}</td>
                                <td>{result.Ungraded}</td>
                                <td>{result['Grade 1']}</td>
                                <td>{result['Grade 2']}</td>
                                <td>{result['Grade 3']}</td>
                                <td>{result['Grade 4']}</td>
                                <td>{result['Grade 5']}</td>
                                <td>{result['Grade 6']}</td>
                                <td>{result['Grade 7']}</td>
                                <td>{result['Grade 8']}</td>
                                <td>{result['Grade 9']}</td>
                                <td>{result['Grade 9.5']}</td>
                                <td>{result['SGC 10']}</td>
                                <td>{result['CGC 10']}</td>
                                <td>{result['PSA 10']}</td>
                                <td>{result['BGS 10']}</td>
                                <td>{result['BGS 10 Black']}</td>
                                <td>{result['CGC 10 Pristine']}</td>
                                <td>{result.final_link}</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan={18}>No results available.</td>
                        </tr>
                    )}
                    {/* Totals Row */}
                    <tr className="totals-row">
                        <td><strong>Totals</strong></td>
                        <td></td>
                        <td><strong>{totalsRow.Ungraded}</strong></td>
                        <td><strong>{totalsRow['Grade 1']}</strong></td>
                        <td><strong>{totalsRow['Grade 2']}</strong></td>
                        <td><strong>{totalsRow['Grade 3']}</strong></td>
                        <td><strong>{totalsRow['Grade 4']}</strong></td>
                        <td><strong>{totalsRow['Grade 5']}</strong></td>
                        <td><strong>{totalsRow['Grade 6']}</strong></td>
                        <td><strong>{totalsRow['Grade 7']}</strong></td>
                        <td><strong>{totalsRow['Grade 8']}</strong></td>
                        <td><strong>{totalsRow['Grade 9']}</strong></td>
                        <td><strong>{totalsRow['Grade 9.5']}</strong></td>
                        <td><strong>{totalsRow['SGC 10']}</strong></td>
                        <td><strong>{totalsRow['CGC 10']}</strong></td>
                        <td><strong>{totalsRow['PSA 10']}</strong></td>
                        <td><strong>{totalsRow['BGS 10']}</strong></td>
                        <td><strong>{totalsRow['BGS 10 Black']}</strong></td>
                        <td><strong>{totalsRow['CGC 10 Pristine']}</strong></td>
                        <td></td>
                    </tr>
                </tbody>
            </table>
            {totals && (
                <div className="totals-display">
                    <h3>Overall Totals</h3>
                    <p>Ungraded: {totals['Ungraded']}</p>
                    <p>Grade 1: {totals['Grade 1']}</p>
                    <p>Grade 2: {totals['Grade 2']}</p>
                    <p>Grade 3: {totals['Grade 3']}</p>
                    <p>Grade 4: {totals['Grade 4']}</p>
                    <p>Grade 5: {totals['Grade 5']}</p>
                    <p>Grade 6: {totals['Grade 6']}</p>
                    <p>Grade 7: {totals['Grade 7']}</p>
                    <p>Grade 8: {totals['Grade 8']}</p>
                    <p>Grade 9: {totals['Grade 9']}</p>
                    <p>Grade 9.5: {totals['Grade 9.5']}</p>
                    <p>SGC 10: {totals['SGC 10']}</p>
                    <p>CGC 10: {totals['CGC 10']}</p>
                    <p>PSA 10: {totals['PSA 10']}</p>
                    <p>BGS 10: {totals['BGS 10']}</p>
                    <p>BGS 10 Black: {totals['BGS 10 Black']}</p>
                    <p>CGC 10 Pristine: {totals['CGC 10 Pristine']}</p>
                </div>
            )}
        </div>
    );
};

export default ResultsPage;
